// Watson Audience ID

val s3 = sqlContext.read.json(
    sc.textFile("s3n://userinteractionmessages/raw/prod/2016/12/15/00/01*.gz")
        .filter(line => line.toLowerCase().contains("travelprofile"))
)
//s3.printSchema();
s3.registerTempTable("uis")
var query = "SELECT context.user.expUserProfileId, context.travelProfile.profile FROM uis "
query += "WHERE context.travelProfile.profile <> ''"
var results = sqlContext.sql(query)
//results.show()

val fmt:java.lang.String = "%-20s %-10s"
println(String.format(fmt, "expUserProfileId", "profile"))
println(String.format(fmt, "----------------", "---------"))

results.collect.foreach(r => {
    println(String.format(fmt, r.getLong(0).toString, r.getString(1)))
})

// Watson Audience ID (Count) - Exp Users with audienceIds

val s3 = sqlContext.read.json(
    sc.textFile("s3n://userinteractionmessages/raw/prod/2016/12/15/*/*.gz")
        .filter(line => line.toLowerCase().contains("travelprofile"))
)
//s3.printSchema();
s3.registerTempTable("uis")
var query = "SELECT COUNT(context.travelProfile.profile) FROM uis WHERE "
query += " logSourceType = 'ExpWeb'"
query += " AND context.user.expUserProfileId > 0"
query += " AND context.travelProfile.profile <> ''"
var results = sqlContext.sql(query)
results.show()

